import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Rutina } from 'src/app/interfaces/rutina';
import { CrudService } from 'src/app/service/crudRutina.service';

@Component({
  selector: 'app-listado',
  templateUrl: './listado.component.html',
  styleUrls: ['./listado.component.css']
})
export class ListadoComponent {
  public listadoRutinas: Rutina[] = [];


  constructor(private service: CrudService, private router: Router){

  }

  ngOnInit(): void {
    this.devolverEmpleados();
  }

  async devolverEmpleados(){
     this.service.buscarRutinas().subscribe(resp => {
      this.listadoRutinas = resp;
    });
  }

  async eliminarEmpleado(id: any){
    this.service.eliminarRutina(id).subscribe(response => {
      console.log(response );
    },(error) => {
      console.log(error);
    });
  }

  actualizarEmpleado(id: any){
    this.router.navigate(['/actualizar/' , id]);
    console.log("click");
  }
}
<div class="container w-full mx-auto my-40">
    <h1 class="text-4xl text-center font-bold mb-4">Listado de Rutinas</h1>


    <table *ngIf="listadoRutinas.length > 0; else noHayEmpleados" class="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-100 dark:bg-gray-700 dark:text-gray-400">
            <tr>
                <th scope="col" class="px-6 py-3">
                   Id
                </th>
                <th scope="col" class="px-6 py-3">
                    Nombre
                </th>
                <th scope="col" class="px-6 py-3">
                    Apellidos
                </th>
                <th scope="col" class="px-6 py-3">
                  Correo
                </th>
                <th scope="col" class="px-6 py-3">
                  Acciones
                </th>
            </tr>
        </thead>
        <tbody *ngFor="let rutina of listadoRutinas">

            <tr class="bg-white dark:bg-gray-800">
              <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                  {{rutina.id}}
              </th>
              <td class="px-6 py-4 ">
                {{rutina.rutina}}
              </td>
              <td class="px-6 py-4">
                <button class="px-4 py-2 bg-red-500 text-white rounded-md mr-2" (click)="eliminarEmpleado(rutina.id)">Eliminar</button>
                <button class="px-4 py-2 bg-blue-500 text-white rounded-md" (click)="actualizarEmpleado(rutina.id)">Actualizar</button>
              </td>
            </tr>     
        </tbody>
    </table>


<div class="w-full max-w-sm bg-white border border-gray-200 rounded-lg shadow dark:bg-gray-800 dark:border-gray-700">
  <div class="flex justify-end px-4 pt-4">
      <button id="dropdownButton" data-dropdown-toggle="dropdown" class="inline-block text-gray-500 dark:text-gray-400 hover:bg-gray-100 dark:hover:bg-gray-700 focus:ring-4 focus:outline-none focus:ring-gray-200 dark:focus:ring-gray-700 rounded-lg text-sm p-1.5" type="button">
          <span class="sr-only">Open dropdown</span>
          <svg class="w-5 h-5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 16 3">
              <path d="M2 0a1.5 1.5 0 1 1 0 3 1.5 1.5 0 0 1 0-3Zm6.041 0a1.5 1.5 0 1 1 0 3 1.5 1.5 0 0 1 0-3ZM14 0a1.5 1.5 0 1 1 0 3 1.5 1.5 0 0 1 0-3Z"/>
          </svg>
      </button>
      <!-- Dropdown menu -->
      <div id="dropdown" class="z-10 hidden text-base list-none bg-white divide-y divide-gray-100 rounded-lg shadow w-44 dark:bg-gray-700">
          <ul class="py-2" aria-labelledby="dropdownButton">
          <li>
              <a href="#" class="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 dark:hover:bg-gray-600 dark:text-gray-200 dark:hover:text-white">Edit</a>
          </li>
          <li>
              <a href="#" class="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 dark:hover:bg-gray-600 dark:text-gray-200 dark:hover:text-white">Export Data</a>
          </li>
          <li>
              <a href="#" class="block px-4 py-2 text-sm text-red-600 hover:bg-gray-100 dark:hover:bg-gray-600 dark:text-gray-200 dark:hover:text-white">Delete</a>
          </li>
          </ul>
      </div>
  </div>
  <div class="flex flex-col items-center pb-10">
      <img class="w-24 h-24 mb-3 rounded-full shadow-lg" src="/docs/images/people/profile-picture-3.jpg" alt="Bonnie image"/>
      <h5 class="mb-1 text-xl font-medium text-gray-900 dark:text-white">Bonnie Green</h5>
      <span class="text-sm text-gray-500 dark:text-gray-400">Visual Designer</span>
      <div class="flex mt-4 md:mt-6">
          <a href="#" class="inline-flex items-center px-4 py-2 text-sm font-medium text-center text-white bg-blue-700 rounded-lg hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Add friend</a>
          <a href="#" class="inline-flex items-center px-4 py-2 text-sm font-medium text-center text-gray-900 bg-white border border-gray-300 rounded-lg hover:bg-gray-100 focus:ring-4 focus:outline-none focus:ring-gray-200 dark:bg-gray-800 dark:text-white dark:border-gray-600 dark:hover:bg-gray-700 dark:hover:border-gray-700 dark:focus:ring-gray-700 ms-3">Message</a>
      </div>
  </div>
</div>

    <ng-template #noHayEmpleados>
        <h3 class="text-2xl font-bold mb-4">Todavía no tienes empleados</h3>
    </ng-template>
  </div>
